import React from 'react';
import { Card } from 'react-bootstrap';

const VendorDetails = ({ vendor }) => {
  return (
    <Card className="vendor-details mb-4">
      <Card.Img variant="top" src={vendor.logoUrl} alt={`${vendor.dispensaryName} logo`} />
      <Card.Body>
        <Card.Title>{vendor.dispensaryName}</Card.Title>
        <Card.Text>
          <strong>Business Hours:</strong>
          {Object.entries(vendor.businessHours).map(([day, hours]) => (
            <div key={day}>
              {day.charAt(0).toUpperCase() + day.slice(1)}: {hours.open} - {hours.close}
            </div>
          ))}
        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default VendorDetails;
